script: |
  super -f text -I q10340.spq | sort > q10340.out

inputs:
  - name: q10340.spq
    data: |
      SELECT col2 * 98 + 90 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 16 + - col1 BETWEEN CAST ( 8 AS INTEGER ) - col2 AND + 83 + 7 * - col2;
  - name: tab2

outputs:
  - name: q10340.out
    data: |
